import React from 'react';
import Card from './Cards'
import Sdata from './Sdata';


console.log(Sdata[0].sname);

 

const App = () =>{
    return(
    <>

    <h1>List og Top 5 Netflix in 2021</h1>
    <div className="flexBox">
   
   
   
     {Sdata.map((val) =>{
       return (
         <Card 
          key = {val.id}
          imgsrc={val.imgsrc}
          title={val.title} 
          sname={val.sname}
          link={val.link}
         />
        );
     })}
   
   
    </div>
    
   
   </>
    )
}

export default App;
